alter trigger M_T_AUDR_G3E_STYLERULE_RULE disable;
alter trigger M_T_AUD_G3E_STYLERULE_RULE disable;

declare
  TYPE numArray IS TABLE OF NUMBER INDEX BY PLS_INTEGER;
  arrSNO  numArray;
  i       PLS_INTEGER;
begin
  select distinct G3E_SNO
    bulk collect into arrSNO
    from G3E_STYLERULE
    where G3E_RULE in ('Primary Conductor - OH Linear', 'Primary Conductor - OH Linear - OMS'
                      ,'Primary Conductor - UG Linear', 'Primary Conductor - UG Linear - OMS'
                      ,'Primary Conductor - OH Detail', 'Primary Conductor - UG Detail');
  
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Conductor - OH Linear';
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Conductor - OH Linear - OMS';
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Conductor - UG Linear';
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Conductor - UG Linear - OMS';

  delete from G3E_STYLERULE where G3E_RULE = 'Primary Conductor - OH Detail'; -- obsolete
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Conductor - UG Detail'; -- obsolete

  for i in 1..arrSNO.COUNT loop
    delete from G3E_LINESTYLE where G3E_SNO = arrSNO(i);
    delete from G3E_STYLE where G3E_SNO = arrSNO(i);
  end loop;
end;
/

alter trigger M_T_AUDR_G3E_STYLERULE_RULE enable;
alter trigger M_T_AUD_G3E_STYLERULE_RULE enable;


alter trigger M_T_AUDR_G3E_STYLERULE_RULE disable;
alter trigger M_T_AUD_G3E_STYLERULE_RULE disable;

declare
  TYPE numArray IS TABLE OF NUMBER INDEX BY PLS_INTEGER;
  arrSNO  numArray;
  i       PLS_INTEGER;
begin
  select distinct G3E_SNO
    bulk collect into arrSNO
    from G3E_STYLERULE
    where G3E_RULE in ('Maintenance Splice Symbol', 'Maintenance Splice Symbol - OMS'
                      ,'Maintenance Splice');
  
  delete from G3E_STYLERULE where G3E_RULE = 'Maintenance Splice Symbol';
  delete from G3E_STYLERULE where G3E_RULE = 'Maintenance Splice Symbol - OMS';
  
  delete from G3E_STYLERULE where G3E_RULE = 'Maintenance Splice'; -- obsolete

  for i in 1..arrSNO.COUNT loop
    delete from G3E_POINTSTYLE where G3E_SNO = arrSNO(i);
    delete from G3E_STYLE where G3E_SNO = arrSNO(i);
  end loop;
end;
/

alter trigger M_T_AUDR_G3E_STYLERULE_RULE enable;
alter trigger M_T_AUD_G3E_STYLERULE_RULE enable;


-- Stroke patterns & symbols

delete from G3E_NORMALIZEDSTROKE where G3E_SPNO between 9101 and 9199;
delete from G3E_POINTSTYLE where G3E_SNO between 201 and 299;




